import { use } from "passport";
import React, { useEffect, useState } from "react";
import axios from "axios";


function Search() {

  const datausr = {
    name: "ElvisClase6:05"
  }

  axios
  .get(`http://localhost:3000/api/consults/search/${datausr.name}`)
  .then((res) => console.log(res.data))

  return <div></div>;
}

export default Search;
